            {id: '2', city: 'Podgorica', day: 'Nedelja', temperature: '25'},
            {id: '3', city: 'Niksic', day: 'Srijeda', temperature: '28'},
            {id: '4', city: 'Bar', day: 'Petak', temperature: '30'}
        ]
    };
    render() {
        return (
    <div className="City-container">

        <div className="Day-container">
            <Day />
