        </div>

        <div className="Citys">
            <ul className="City-list">
                <li>Budva</li>
                <li>Podgorica</li>
                <li>Niksic</li>
                <li>Cetinje</li>
            </ul>
        </div>
        
    </div>
        );
    }
}

export default Weather;
